<script setup lang="ts">
import { ref, onMounted, onBeforeUnmount } from 'vue'
import lottie from 'lottie-web'
import { useRouter } from 'vue-router'


import Title from './title.vue'
import Info from './info.vue'


import jiazaiData from '../../assets/jiazai.json'

const isIntroPlaying = ref(true)
const isLoadingIntro = ref(true)
const canvasRef = ref<HTMLCanvasElement | null>(null)
const lottieRef = ref<HTMLDivElement | null>(null)

const totalFrames = 106 // 00000 - 00106 inclusive
const fps = 24
const frameDurationMs = 1000 / fps
const devicePixelRatioClamp = 1 // keep pixel work low for smoothness
const maxConcurrency = 6
const fadeOutFrames = 10
const fadeDurationMs = fadeOutFrames * frameDurationMs

let animationHandle: number | null = null
let lastTimestampMs = 0
let accumulatedMs = 0
let currentFrameIndex = 0
let cw = 0
let ch = 0
let crop: { sx: number; sy: number; sw: number; sh: number } | null = null
const bufferedBitmaps: Map<number, ImageBitmap> = new Map()
const overlayOpacity = ref(1)
let isFadingOut = false
let fadeStartTimeMs = 0


// OSS base and helpers with fallback
const NEW_OSS_BASE = 'https://tc-weshop.oss-cn-beijing.aliyuncs.com/lotter'
const OLD_OSS_BASE = 'https://steppy-dev.oss-cn-guangzhou.aliyuncs.com/lotter'
const buildOssCandidates = (relative: string): string[] => {
  const clean = relative.replace(/^\/+/, '')
  return [
    `${NEW_OSS_BASE}/${clean}`,
    `${OLD_OSS_BASE}/${clean}`,
  ]
}
const pickFirstReachable = async (urls: string[]): Promise<string> => {
  // Use Image probe to avoid CORS blocking fetch
  const probe = (u: string) => new Promise<boolean>((resolve) => {
    const img = new Image()
    img.crossOrigin = 'anonymous'
    img.onload = () => resolve(true)
    img.onerror = () => resolve(false)
    img.src = u
  })
  for (const u of urls) {
    if (await probe(u)) return u
  }
  return urls[0]
}

// simple carousel for header images (resolved on mount)
const carouselImages = ref<string[]>([])
const currentCarouselIndex = ref(0)
let carouselTimer: number | null = null

// click zoom then navigate
const router = useRouter()
const isButtonAnimating = ref(false)

import { http } from '@/util/http'
import { useOpenIdStore } from '@/stores/openId'
const openIdStore = useOpenIdStore()
const handleVote = async () => {
  const res = await http.post('/get-vote',{
    openId: openIdStore.openId
  })
  if (res.data.success) {
    router.push('/vote_result')
  }else{
    router.push('/vote')
  }
  // router.push('/vote')

}


function frameCandidates(index: number): string[] {
  // 仅在 animtion 目录下，无中文路径/前缀；兼容 0 基和 1 基编号
  const s0 = String(index).padStart(5, '0')
  const s1 = String(index + 1).padStart(5, '0')
  const relatives = [
    `animtion/${s0}.png`,
    `animtion/${s1}.png`,
  ]
  const urls = relatives.flatMap((r) => buildOssCandidates(r))
  return Array.from(new Set(urls))
}

function resizeCanvasToWindow(canvas: HTMLCanvasElement) {
  const dpr = devicePixelRatioClamp
  const width = window.innerWidth
  const height = window.innerHeight
  cw = Math.floor(width * dpr)
  ch = Math.floor(height * dpr)
  canvas.width = cw
  canvas.height = ch
  canvas.style.width = width + 'px'
  canvas.style.height = height + 'px'
}

function loadImageFromCandidates(candidates: string[]): Promise<HTMLImageElement> {
  return new Promise((resolve, reject) => {
    const tryNext = (idx: number) => {
      if (idx >= candidates.length) {
        reject(new Error('All image candidates failed'))
        return
      }
      const src = candidates[idx]
      const image = new Image()
      image.crossOrigin = 'anonymous'
      image.src = src
      const done = () => resolve(image)
      image.onload = () => {
        if (typeof (image as any).decode === 'function') {
          ;(image as any).decode().then(done).catch(done)
        } else {
          done()
        }
      }
      image.onerror = () => tryNext(idx + 1)
    }
    tryNext(0)
  })
}

function computeCoverCrop(iw: number, ih: number) {
  const targetAR = cw / ch
  const imageAR = iw / ih
  if (imageAR > targetAR) {
    const sh = ih
    const sw = Math.floor(ih * targetAR)
    const sx = Math.floor((iw - sw) / 2)
    const sy = 0
    crop = { sx, sy, sw, sh }
  } else {
    const sw = iw
    const sh = Math.floor(iw / targetAR)
    const sx = 0
    const sy = Math.floor((ih - sh) / 2)
    crop = { sx, sy, sw, sh }
  }
}

async function preloadAllFramesBitmaps() {
  let completed = 0
  let nextIndex = 0
  let inFlight = 0
  return new Promise<void>((resolve) => {
    const launchNext = () => {
      while (inFlight < maxConcurrency && nextIndex < totalFrames) {
        const index = nextIndex++
        inFlight += 1
        loadImageFromCandidates(frameCandidates(index))
          .then(async (img) => {
            if (!crop) {
              const iw = img.naturalWidth || img.width
              const ih = img.naturalHeight || img.height
              computeCoverCrop(iw, ih)
            }
            const bmp = await createImageBitmap(
              img,
              crop!.sx,
              crop!.sy,
              crop!.sw,
              crop!.sh,
              { resizeWidth: cw, resizeHeight: ch, resizeQuality: 'high' }
            )
            bufferedBitmaps.set(index, bmp)
          })
          .catch(() => {
            // skip on error, but keep timeline moving
          })
          .finally(() => {
            inFlight -= 1
            completed += 1
            if (completed >= totalFrames) {
              resolve()
            } else {
              launchNext()
            }
          })
      }
    }
    launchNext()
  })
}

function startAnimation() {
  const canvas = canvasRef.value
  if (!canvas) return
  const ctx = canvas.getContext('2d')
  if (!ctx) return

  const onResize = () => resizeCanvasToWindow(canvas)
  onResize()
  window.addEventListener('resize', onResize)

  const step = (now: number) => {
    if (!lastTimestampMs) lastTimestampMs = now
    const delta = now - lastTimestampMs
    lastTimestampMs = now
    accumulatedMs += delta

    if (!isFadingOut) {
      while (accumulatedMs >= frameDurationMs) {
        accumulatedMs -= frameDurationMs
        currentFrameIndex += 1
      }

      // trigger fade-out near the end and freeze on the current (near-final) frame
      if (currentFrameIndex >= totalFrames - fadeOutFrames) {
        isFadingOut = true
        fadeStartTimeMs = now
        currentFrameIndex = Math.min(currentFrameIndex, totalFrames - 1)
      }
    } else {
      // during fade-out, compute opacity based on time
      const elapsed = now - fadeStartTimeMs
      overlayOpacity.value = Math.max(0, Math.min(1, 1 - elapsed / fadeDurationMs))
      if (overlayOpacity.value <= 0) {
        isIntroPlaying.value = false
        cancelAnimationFrameIfAny()
        window.removeEventListener('resize', onResize)
        return
      }
    }

    // draw only when bitmap available, keep previous frame otherwise
    const bmp = bufferedBitmaps.get(currentFrameIndex)
    if (bmp) {
      ctx.clearRect(0, 0, cw, ch)
      ctx.drawImage(bmp, 0, 0)
      bufferedBitmaps.delete(currentFrameIndex)
    }

    animationHandle = requestAnimationFrame(step)
  }

  animationHandle = requestAnimationFrame(step)
}

function cancelAnimationFrameIfAny() {
  if (animationHandle !== null) {
    cancelAnimationFrame(animationHandle)
    animationHandle = null
  }
}

onMounted(async () => {
  // Prepare canvas size up-front for cropping/resizing
  const tempCanvas = document.createElement('canvas')
  resizeCanvasToWindow(tempCanvas)

  // Lottie loading animation
  let lottieInstance: any | null = null
  if (lottieRef.value) {
    lottieInstance = lottie.loadAnimation({
      container: lottieRef.value,
      renderer: 'svg',
      loop: true,
      autoplay: true,
      animationData: jiazaiData as unknown as object
    })
  }

  // resolve carousel images with fallback, then start carousel
  carouselImages.value = await Promise.all([
    pickFirstReachable(buildOssCandidates('xiezi/1.png')),
    pickFirstReachable(buildOssCandidates('xiezi/2.png')),
    pickFirstReachable(buildOssCandidates('xiezi/3.png')),
    pickFirstReachable(buildOssCandidates('xiezi/4.png')),
    pickFirstReachable(buildOssCandidates('xiezi/5.png')),
  ])
  if (!carouselTimer) {
    // Preload carousel images to avoid decode jank during swap (not awaited)
    ;(() => {
      carouselImages.value.forEach((src: string) => {
        const img = new Image()
        try {
          img.decoding = 'async'
          ;(img as any).loading = 'eager'
        } catch {}
        img.src = src
      })
    })()
    carouselTimer = window.setInterval(() => {
      currentCarouselIndex.value = (currentCarouselIndex.value + 1) % carouselImages.value.length
    }, 2000)
  }

  // Preload all bitmaps before starting playback
  await preloadAllFramesBitmaps()

  isLoadingIntro.value = false
  if (lottieInstance) {
    lottieInstance.destroy()
    lottieInstance = null
  }
  requestAnimationFrame(() => {
    startAnimation()
  })
})

onBeforeUnmount(() => {
  cancelAnimationFrameIfAny()
  if (carouselTimer) {
    clearInterval(carouselTimer)
    carouselTimer = null
  }
})




</script>

